python3 << 'EOF'
import json
from pathlib import Path
from collections import Counter

logs_path = Path(".claude/logging")
queries = []

for jsonl in logs_path.rglob("*.jsonl"):
    try:
        for line in jsonl.read_text().strip().split("\n"):
            if not line.strip():
                continue
            event = json.loads(line)

            # Extract user prompts - correct path is data.prompt
            if event.get("type") == "UserPromptSubmit":
                prompt = event.get("data", {}).get("prompt", "")
                if prompt and len(prompt) > 10 and len(prompt) < 1000:
                    queries.append({
                        "text": prompt.strip(),
                        "timestamp": event.get("ts"),
                        "session": str(jsonl.stem)
                    })
    except Exception as e:
        pass

print(f"Total user prompts extracted: {len(queries)}")

# Deduplicate and filter
unique_queries = {}
for q in queries:
    text = q["text"].lower().strip()
    # Skip very short or generic
    if len(text) < 15:
        continue
    # Skip "please proceed" type
    if text in ["please proceed", "please proceed.", "proceed", "continue", "yes", "no"]:
        continue
    if text not in unique_queries:
        unique_queries[text] = q

print(f"Unique meaningful queries: {len(unique_queries)}")

# Categorize by apparent intent
categories = Counter()
samples_by_category = {}

for text, q in list(unique_queries.items())[:200]:
    # Simple categorization
    if "how" in text.lower() or "what" in text.lower() or "where" in text.lower():
        cat = "question"
    elif "fix" in text.lower() or "error" in text.lower() or "bug" in text.lower():
        cat = "debugging"
    elif "create" in text.lower() or "add" in text.lower() or "implement" in text.lower():
        cat = "creation"
    elif "test" in text.lower() or "run" in text.lower():
        cat = "execution"
    else:
        cat = "other"

    categories[cat] += 1
    if cat not in samples_by_category:
        samples_by_category[cat] = []
    if len(samples_by_category[cat]) < 5:
        samples_by_category[cat].append(text[:120])

print(f"\nCategories: {dict(categories)}")
print(f"\nSamples by category:")
for cat, samples in samples_by_category.items():
    print(f"\n{cat.upper()}:")
    for s in samples:
        print(f"  - {s}...")
